import 'dart:async';
import 'dart:convert';
import 'dart:io';

import '../../../style_dart.dart';

///
class WebDev extends StatefulComponent {
  ///
  WebDev(
      {this.watchChanges = true,
      required String projectDirectory,
      this.builtDirectory = 'build',
      this.developmentDir = 'web',
      this.buildInitialize = true,
      GlobalKey? key})
      : directory = projectDirectory.endsWith('/')
            ? projectDirectory
            : projectDirectory.endsWith(Platform.pathSeparator)
                ? projectDirectory
                : '$projectDirectory/',
        assert(!Uri.parse(builtDirectory).isAbsolute),
        assert(!Uri.parse(developmentDir).isAbsolute),
        super(key: key);

  ///
  final String directory;

  ///
  final bool buildInitialize;

  ///
  final String builtDirectory;

  ///
  final String developmentDir;

  ///
  final bool watchChanges;

  @override
  WebDevState createState() => WebDevState();
}

///
class WebDevState extends State<WebDev> {
  ///
  late String buildDir = component.builtDirectory;

  ///
  Future<void> compile() async {
    if (!component.buildInitialize) {
      return;
    }

    var buildDir = Directory(getBuildDir());
    var packagesDir = Directory('${getBuildDir()}/packages');

    if (!(await buildDir.exists())) {
      await buildDir.create();
    }

    if (!(await packagesDir.exists())) {
      await packagesDir.create();
    }

    var depsFile = File('${getBuildDir()}/'
        'packages/build_web_compilers/src/dev_compiler_stack_trace/stack_trace_mapper.dart.js.deps');
    var mapFile = File(
        '${getBuildDir()}/packages/build_web_compilers/src/dev_compiler_stack_trace/stack_trace_mapper.dart.js.map');
    var manifest = File('${getBuildDir()}/.build.manifest');
    await manifest.writeAsString('.packages');

    depsFile.createSync(recursive: true);
    mapFile.createSync(recursive: true);

    dirsCreated.complete(true);

    await depsFile.writeAsString(_deps, mode: FileMode.write);
    await mapFile.writeAsString(_map, mode: FileMode.write);
    var args = [
      'pub',
      'run',
      'build_runner',
      component.watchChanges ? 'watch' : 'build',
      '--output',
      buildDir.path,
      '--release',
      '--define',
      'build_web_compilers:entrypoint=compiler=dartdevc',
      '--use-polling-watcher',
      '--delete-conflicting-outputs'
    ];
    var process = await Process.start('dart', args,
        workingDirectory: component.directory);

    var file =
        File('${component.directory}logs/${_dateFormat(DateTime.now())}.log');
    var exists = file.existsSync();
    if (!exists) {
      file.createSync(recursive: true);
    }
    var sink = file.openWrite(mode: FileMode.append);
    sink.add(utf8.encode("started dart ${args.join(" ")}\n"));
    await sink.addStream(process.stdout);
    exitCode.complete(await process.exitCode);
    sink.add(utf8.encode('Build Completed with $exitCode'));
    await sink.done;
  }

  ///
  static String _dateFormat(DateTime dateTime) =>
      '${dateTime.year}-${dateTime.month}'
      '-${dateTime.day}--${dateTime.hour}'
      '-${dateTime.minute}--${dateTime.second}';

  ///
  Completer<int> exitCode = Completer();

  ///
  Completer<bool> dirsCreated = Completer();

  @override
  void initState() {
    if (!Directory(getBuildDir()).existsSync()) {
      Directory(getBuildDir()).createSync();
    }
    compile();
    super.initState();
  }

  @override
  Component build(BuildContext context) => Gateway(children: [
        ContentDelivery('${getBuildDir()}/${component.developmentDir}/',
            useWatch: false,
            cacheFiles: false,
            useLastModified: true, beforeLoad: () {
          if (component.watchChanges) {
            return exitCode.future;
          }

          return dirsCreated.future;
        }),
        Route('packages',
            child: ContentDelivery('${getBuildDir()}/packages/',
                useWatch: false, cacheFiles: false, useLastModified: true,
                // additional: {
                //   "packages/build_web_compilers/src/dev_compiler_stack_trace/stack_trace_mapper.dart.js.deps":
                //       utf8.encode(_deps) as Uint8List,
                //   "packages/build_web_compilers/src/dev_compiler_stack_trace/stack_trace_mapper.dart.js.map":
                //       utf8.encode(_map) as Uint8List
                // },
                beforeLoad: () {
              if (!component.watchChanges) {
                return exitCode.future;
              }

              return dirsCreated.future;
            }),
            handleUnknownAsRoot: true)
      ]);

  ///
  String getBuildDir() => '${component.directory}$buildDir';
}

